if (!Boolean(Noodl.Variables.supabase)) {
  console.error("Supabase client is not initialized")
  return
}

let { error } = await Noodl.Variables.supabase.auth.signOut()

if (!!error) {

    console.error(JSON.stringify(error))
    Outputs.error = error
    Outputs.Failure()

} else {

    Noodl.Objects.currentUser.auth = null
    Noodl.Objects.currentUser.profile = null
    Noodl.Objects.currentUser.role = null
    Noodl.Objects.currentUser.name = null
    Noodl.Objects.currentUser.company = null
    Noodl.Objects.currentUser.email = null
    Noodl.Objects.currentUser.session = null
    Noodl.Objects.currentUser.loggedIn = false
    console.log("[logout] currentUser = ", Noodl.Objects.currentUser)

    Outputs.Success()
}

