/* Define the keyframes for the slide-in animation */
@keyframes slideFromLeft {
  0% {
    transform: translateX(-100%);
  }
  100% {
    transform: translateX(0);
  }
}

/* Define the keyframes for the slide-out animation */
@keyframes slideToLeft {
  0% {
    transform: translateX(0);
  }
  100% {
    transform: translateX(-100%);
  }
}

/* Apply the slide-in animation to the element */
.slide-in-element {
  animation: slideFromLeft 0.5s ease-out; /* Adjust the duration and timing function as needed */
}

/* Apply the slide-out animation to hide the element */
.slide-in-element.hide {
  animation: slideToLeft 0.5s ease-in; /* Adjust the duration and timing function as needed */
}

